(2, 950387, 'A Minecraft Movie', 'Four misfits find themselves struggling with ordinary problems when they are suddenly pulled through a mysterious portal into the Overworld: a bizarre, cubic wonderland that thrives on imagination. To get back home, they\'ll have to master this world while embarking on a magical quest with an unexpected, expert crafter, Steve.', '/yFHHfHcUgGAxziP1C3lLt0q2T4s.jpg', '/2Nti3gYAX513wvhp8IiLL6ZDyOm.jpg', '2025-03-31', 6.5, 1500, 580.183, '[10751, 35, 12, 14]', 'en', 'A Minecraft Movie', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:26'),
(3, 574475, 'Final Destination Bloodlines', 'Plagued by a violent recurring nightmare, college student Stefanie heads home to track down the one person who might be able to break the cycle and save her family from the grisly demise that inevitably awaits them all.', '/6WxhEvFsauuACfv8HyoVX6mZKFj.jpg', '/uIpJPDNFoeX0TVml9smPrs9KUVx.jpg', '2025-05-14', 7.0, 463, 455.008, '[27, 9648]', 'en', 'Final Destination Bloodlines', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:26'),
(4, 1232546, 'Until Dawn', 'One year after her sister Melanie mysteriously disappeared, Clover and her friends head into the remote valley where she vanished in search of answers. Exploring an abandoned visitor center, they find themselves stalked by a masked killer and horrifically murdered one by one...only to wake up and find themselves back at the beginning of the same evening.', '/juA4IWO52Fecx8lhAsxmDgy3M3.jpg', '/icFWIk1KfkWLZnugZAJEDauNZ94.jpg', '2025-04-23', 6.5, 442, 355.973, '[27, 9648]', 'en', 'Until Dawn', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:26'),
(5, 575265, 'Mission: Impossible - The Final Reckoning', 'Ethan Hunt and team continue their search for the terrifying AI known as the Entity — which has infiltrated intelligence networks all over the globe — with the world\'s governments and a mysterious ghost from Hunt\'s past on their trail. Joined by new allies and armed with the means to shut the Entity down for good, Hunt is in a race against time to prevent the world as we know it from changing forever.', '/z53D72EAOxGRqdr7KXXWp9dJiDe.jpg', '/1p5aI299YBnqrEEvVGJERk2MXXb.jpg', '2025-05-17', 7.1, 405, 327.945, '[28, 12, 53]', 'en', 'Mission: Impossible - The Final Reckoning', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(6, 1197306, 'A Working Man', 'Levon Cade left behind a decorated military career in the black ops to live a simple life working construction. But when his boss\'s daughter, who is like family to him, is taken by human traffickers, his search to bring her home uncovers a world of corruption far greater than he ever could have imagined.', '/6FRFIogh3zFnVWn7Z6zcYnIbRcX.jpg', '/fTrQsdMS2MUw00RnzH0r3JWHhts.jpg', '2025-03-26', 6.7, 1039, 292.299, '[28, 80, 53]', 'en', 'A Working Man', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(7, 1098006, 'Fountain of Youth', 'A treasure-hunting mastermind assembles a team for a life-changing adventure. But to outwit and outrun threats at every turn, he\'ll need someone even smarter than he is: his estranged sister.', '/4iWjGghUj2uyHo2Hyw8NFBvsNGm.jpg', '/aESb695wTIF0tB7RTGRebnYrjFK.jpg', '2025-05-19', 6.5, 260, 265.848, '[12, 14, 9648]', 'en', 'Fountain of Youth', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(8, 896536, 'The Legend of Ochi', 'In a remote village on the island of Carpathia, a shy farm girl named Yuri is raised to fear an elusive animal species known as ochi. But when Yuri discovers a wounded baby ochi has been left behind, she escapes on a quest to bring him home.', '/wVujUVvY4qvKARAslItQ4ARKqtz.jpg', '/dJ1JpHuTCRxtGpRq8bQzk2jBqTi.jpg', '2025-04-18', 6.3, 86, 232.677, '[10751, 14, 12]', 'en', 'The Legend of Ochi', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(9, 1001414, 'Fear Street: Prom Queen', 'Who will be voted queen at Shadyside High\'s 1988 prom? For underdog Lori, competition is cutthroat even before someone starts killing off the candidates.', '/gevScWYkF8l5i9NjFSXo8HfPNyy.jpg', '/qspghhpOyaBGgZDJoCbV2o9WNMU.jpg', '2025-05-23', 5.4, 181, 253.839, '[27, 9648]', 'en', 'Fear Street: Prom Queen', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(10, 1241436, 'Warfare', 'A platoon of Navy SEALs embarks on a dangerous mission in Ramadi, Iraq, with the chaos and brotherhood of war retold through their memories of the event.', '/srj9rYrjefyWqkLc6l2xjTGeBGO.jpg', '/cJvUJEEQ86LSjl4gFLkYpdCJC96.jpg', '2025-04-09', 7.3, 446, 228.148, '[10752, 28]', 'en', 'Warfare', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(11, 447273, 'Snow White', 'Following the benevolent King\'s disappearance, the Evil Queen dominated the once fair land with a cruel streak. Princess Snow White flees the castle when the Queen, in her jealousy over Snow White\'s inner beauty, tries to kill her. Deep into the dark woods, she stumbles upon seven magical dwarves and a young bandit named Jonathan. Together, they strive to survive the Queen\'s relentless pursuit and aspire to take back the kingdom.', '/oLxWocqheC8XbXbxqJ3x422j9PW.jpg', '/tyfO9jHgkhypUFizRVYD0bytPjP.jpg', '2025-03-12', 4.3, 961, 220.917, '[10751, 14]', 'en', 'Snow White', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(12, 1480799, 'The Great Escape', '', '/h7shL668vhC2wsZQSBWzxkMuZ8K.jpg', '/v6MPbA9ev0yttbILLjGOo2nh31h.jpg', '2023-05-26', 5.7, 3, 181.599, '[28, 53]', 'pt', 'The Great Escape', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(13, 977294, 'Tin Soldier', 'An ex-special forces operative seeks revenge against a cult leader who has corrupted his former comrades, the Shinjas. This leader, known as The Bokushi, promises veterans a purpose and protection, but is revealed to be a destructive influence. The ex-soldier, Nash Cavanaugh, joins forces with military operative Emmanuel Ashburn to infiltrate the Bokushi\'s fortress and expose his reign of terror', '/lFFDrFLXywFhy6khHes1LCFVMsL.jpg', '/jRvhP4AfFnJ03lCQhp1fie7XPSd.jpg', '2025-05-22', 5.0, 41, 185.072, '[28, 53]', 'en', 'Tin Soldier', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(14, 1297028, 'Rosario', 'Wall Street stockbroker Rosario Fuentes returns to her grandmother\'s apartment after her sudden death. While sorting through her belongings, Rosario discovers a hidden chamber that\'s filled with occult artifacts tied to dark generational rituals. As supernatural occurrences begin to plague her, she must confront her family\'s buried secrets and face the truth about the sacrifices and choices they made.', '/beLZhuHT97849WkWgty2X1hkWUa.jpg', '/d5aBTObiUzqGZMohXtQKY4FMGvb.jpg', '2025-05-01', 4.8, 23, 180.992, '[27]', 'en', 'Rosario', 0, 0, '2025-05-28 04:39:14', '2025-05-29 00:03:27'),
(15, 986056, 'Thunderbolts*', 'After finding themselves ensnared in a death trap, seven disillusioned castoffs must embark on a dangerous mission that will force them to confront the darkest corners of their pasts.', '/m9EtP1Yrzv6v7dMaC9mRaGhd1um.jpg', '/rthMuZfFv4fqEU4JVbgSW9wQ8rs.jpg', '2025-04-30', 7.4, 1010, 151.606, '[28, 878, 12]', 'en', 'Thunderbolts*', 0, 0, '2025-05-28 04:39:16', '2025-05-29 00:03:27'),
(16, 1233069, 'Exterritorial', 'When her son vanishes inside a US consulate, ex-special forces soldier Sara does everything in her power to find him — and uncovers a dark conspiracy.', '/jM2uqCZNKbiyStyzXOERpMqAbdx.jpg', '/14UFWFJsGeInCbhTiehRLTff4Yx.jpg', '2025-04-29', 6.7, 407, 148.789, '[53, 28]', 'de', 'Exterritorial', 0, 0, '2025-05-28 04:39:16', '2025-05-29 00:03:27'),
(17, 11544, 'Lilo & Stitch', 'As Stitch, a runaway genetic experiment from a faraway planet, wreaks havoc on the Hawaiian Islands, he becomes the mischievous adopted alien \"puppy\" of an independent little girl named Lilo and learns about loyalty, friendship, and ʻohana, the Hawaiian tradition of family.', '/m13Vbzv7R2GMAl3GXFrkmMEgCFQ.jpg', '/aIglP9Z5gtkQf7Fidb4NRv2gfDj.jpg', '2002-06-21', 7.5, 6529, 164.295, '[16, 10751, 35]', 'en', 'Lilo & Stitch', 0, 0, '2025-05-28 04:39:16', '2025-05-29 00:03:27'),
(18, 897160, 'Brave Citizen', 'An expelled boxing champion, who now is a high-school teacher, witnesses intolerable violence and throws her first punch to build justice against it, while putting on a mask.', '/6Ea5i6APeTfm4hHh6dg5Z733JVS.jpg', '/jmLfuMFn6o4Rkp7dzT57Vp2GpoQ.jpg', '2023-10-25', 6.8, 43, 143.337, '[28, 18, 35]', 'ko', '용감한 시민', 0, 0, '2025-05-28 04:39:16', '2025-05-29 00:03:27'),
(19, 1094473, 'Bambi: A Life in the Woods', 'The life of Bambi, a male roe deer, from his birth through childhood, the loss of his mother, the finding of a mate, the lessons he learns from his father, and the experience he gains about the dangers posed by human hunters in the forest.', '/vWNVHtwOhcoOEUSrY1iHRGbgH8O.jpg', '/bIh56F8e5EaZ3r2nD1hXAOisItZ.jpg', '2024-10-16', 5.9, 23, 134.886, '[12, 10751, 99]', 'fr', 'Bambi, l\'histoire d\'une vie dans les bois', 0, 0, '2025-05-28 04:39:16', '2025-05-28 04:39:16'),
(20, 324544, 'In the Lost Lands', 'A queen sends the powerful and feared sorceress Gray Alys to the ghostly wilderness of the Lost Lands in search of a magical power, where she and her guide, the drifter Boyce, must outwit and outfight both man and demon.', '/dDlfjR7gllmr8HTeN6rfrYhTdwX.jpg', '/op3qmNhvwEvyT7UFyPbIfQmKriB.jpg', '2025-02-27', 6.4, 397, 139.775, '[28, 14, 12]', 'en', 'In the Lost Lands', 0, 0, '2025-05-28 04:39:16', '2025-05-29 00:03:27'),
(21, 1144430, 'Last Bullet', 'Car genius Lino returns to conclude his vendetta against Areski and the corrupt commander who ruined their lives in this turbo-charged trilogy finale.', '/qycPITRqXgPai7zj1gKffjCdSB5.jpg', '/4A5HH9HkCPqAwyYL6CnA0mxbYjn.jpg', '2025-05-06', 6.7, 143, 132.606, '[28, 80, 53, 18]', 'fr', 'Balle perdue 3', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:27'),
(22, 822119, 'Captain America: Brave New World', 'After meeting with newly elected U.S. President Thaddeus Ross, Sam finds himself in the middle of an international incident. He must discover the reason behind a nefarious global plot before the true mastermind has the entire world seeing red.', '/pzIddUEMWhWzfvLI3TwxUG2wGoi.jpg', '/8eifdha9GQeZAkexgtD45546XKx.jpg', '2025-02-12', 6.1, 1922, 126.851, '[28, 53, 878]', 'en', 'Captain America: Brave New World', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:27'),
(23, 1241982, 'Moana 2', 'After receiving an unexpected call from her wayfinding ancestors, Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.', '/aLVkiINlIeCkcZIzb7XHzPYgO6L.jpg', '/zo8CIjJ2nfNOevqNajwMRO6Hwka.jpg', '2024-11-21', 7.1, 2402, 118.376, '[16, 12, 10751, 35]', 'en', 'Moana 2', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(24, 1448938, 'Abduct', 'A woman\'s peaceful mountain getaway takes a bizarre turn when her boyfriend disappears, and a random naked man shows up claiming to be him.', '/2ZTp5eQ8C8W70rvXCkbdHQW0sM9.jpg', '/ipW8WreRwTWyOPUIAUPM3kMKJCg.jpg', '2025-04-02', 4.6, 8, 127.875, '[27]', 'en', 'Abduct', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:27'),
(25, 1092073, 'The Haunting at Saint Joseph\'s', 'An engaged Muslim doctor, her fiancé, and their friends go on a holiday at St. Joseph’s Guesthouse, unaware that it was the site of a sacrifice of an innocent centuries before. They soon come to believe that it\'s haunted and causing them to go crazy, as their emotions spiral out of control.', '/eDzQFxs0KTzHUPkIR0c44TSGJUR.jpg', '/bfVl8J5sI2T4Bu0p3350WtNwe8o.jpg', '2023-02-26', 4.6, 11, 107.099, '[27, 53]', 'en', 'The Haunting at Saint Joseph\'s', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(26, 668489, 'Havoc', 'When a drug heist swerves lethally out of control, a jaded cop fights his way through a corrupt city\'s criminal underworld to save a politician\'s son.', '/ubP2OsF3GlfqYPvXyLw9d78djGX.jpg', '/65MVgDa6YjSdqzh7YOA04mYkioo.jpg', '2025-04-25', 6.5, 717, 107.598, '[28, 80, 53]', 'en', 'Havoc', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(27, 1233413, 'Sinners', 'Trying to leave their troubled lives behind, twin brothers return to their hometown to start again, only to discover that an even greater evil is waiting to welcome them back.', '/jYfMTSiFFK7ffbY2lay4zyvTkEk.jpg', '/nAxGnGHOsfzufThz20zgmRwKur3.jpg', '2025-04-16', 7.5, 789, 100.773, '[27, 53]', 'en', 'Sinners', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(28, 710258, 'Rust', 'Infamous outlaw Harland Rust breaks his estranged grandson Lucas out of prison, after Lucas is convicted to hang for an accidental murder. The two must outrun legendary U.S Marshal Wood Helm and bounty hunter Fenton \"Preacher\" Lang who are hot on their tails. Deeply buried secrets rise from the ashes and an unexpected familial bond begins to form as the mismatched duo tries to survive the merciless American Frontier.', '/tbJ3RkA2s6X5qrBzrYHYTxvDBui.jpg', '/12tEzU0bNYKIjXXEwI5abuOotHF.jpg', '2025-05-01', 6.3, 55, 104.672, '[37]', 'en', 'Rust', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(29, 1403735, 'Laila', 'Sonu Model, a renowned beautician from the old city, is forced to disguise himself as Laila, leading to a series of comedic, romantic, and action-packed events. Chaos ensues in this hilarious laugh riot', '/l4gsNxFPGpzbq0D6QK1a8vO1lBz.jpg', '/vNUwK5P42m81uG57kKI1WxSZwIQ.jpg', '2025-02-14', 5.0, 3, 101.506, '[35, 10749]', 'te', 'లైలా', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(30, 1225915, 'Jewel Thief - The Heist Begins', 'In this high-octane battle of wits and wills, ingenious con artist Rehan devises a diamond heist while trying to outsmart Rajan, his sadistic adversary.', '/eujLbO0kf1eqWC8XpHUJdtAVW2J.jpg', '/kFXtAwJYbRTqiyQpE9kDc8qEP3X.jpg', '2025-04-24', 6.7, 43, 105.385, '[28, 53]', 'hi', 'ज्वेल थीफ़ - The Heist Begins', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(31, 1359977, 'Conjuring the Cult', 'After discovering his blood-soaked daughter dead in the bathtub, David Bryson attends a self-help group to help save him from his ghostly nightmares. But when a group of mysterious cult-like women offer to help him resurrect his daughter. David\'s choices will not just decide his fate... but the fate of his dead daughter\'s SOUL.', '/t4MiAeYpjL7saYvqvcn9xtOfA4K.jpg', '/mrmaTVp7PTBkjj5G62cE9pjrENg.jpg', '2024-10-01', 5.4, 26, 93.397, '[27, 18]', 'en', 'Conjuring the Cult', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:18'),
(32, 1017129, 'Detective Chirp & the Golden Beehive', 'Residents of Honey Valley are getting ready for their favorite holiday - City Day, when all citizens have the opportunity to admire a unique artifact - the Golden Hive. According to legend, it was found by the founders of Honey Valley, and legend has it that thousands of misfortunes will fall upon the town if the Hive disappears. On the eve of the holiday, the Beehive is kidnapped. The squirrel Chink, Sophie\'s owl detective\'s assistant, is blamed for this. Chink and his friends have to unravel the case, find the real crook and return not only the Golden Hive, but also peace to the Valley.', '/oxCPceQ4exEuxU3vfRl8doWyqj8.jpg', '/7yGFEqcGSZqtk0KUK94PAR3xvx6.jpg', '2022-11-17', 8.0, 1, 85.418, '[16, 35, 9648, 12, 10751]', 'ru', 'Чинк - хвостатый детектив', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(33, 1233620, '¡Qué Huevos, Sofía!', 'Sofia gives everything for the company where she works, but the position she was promised is given to the owner\'s niece. She and other colleagues, tired of working for an unbearable boss, quit to start their own bakery. What they did not consider is that their ex-boss will not rest until he sees them fail.', '/hhfWpdNmPwU1VV7zhNA1nOMbHkH.jpg', '/8FmvRL0XPAdCFRs4w2wcYBwuKUO.jpg', '2025-02-27', 8.8, 18, 83.128, '[35]', 'es', '¡Qué Huevos, Sofía!', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(34, 762509, 'Mufasa: The Lion King', 'Mufasa, a cub lost and alone, meets a sympathetic lion named Taka, the heir to a royal bloodline. The chance meeting sets in motion an expansive journey of a group of misfits searching for their destiny.', '/lurEK87kukWNaHd0zYnsi3yzJrs.jpg', '/oHPoF0Gzu8xwK4CtdXDaWdcuZxZ.jpg', '2024-12-18', 7.4, 2151, 84.838, '[12, 10751, 16]', 'en', 'Mufasa: The Lion King', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(35, 575264, 'Mission: Impossible - Dead Reckoning Part One', 'Ethan Hunt and his IMF team embark on their most dangerous mission yet: To track down a terrifying new weapon that threatens all of humanity before it falls into the wrong hands. With control of the future and the world\'s fate at stake and dark forces from Ethan\'s past closing in, a deadly race around the globe begins. Confronted by a mysterious, all-powerful enemy, Ethan must consider that nothing can matter more than his mission—not even the lives of those he cares about most.', '/NNxYkU70HPurnNCSiCjYAmacwm.jpg', '/TFTfzrkX8L7bAKUcch6qLmjpLu.jpg', '2023-07-08', 7.5, 4284, 85.405, '[28, 12, 53]', 'en', 'Mission: Impossible - Dead Reckoning Part One', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(36, 9532, 'Final Destination', 'After a teenager has a terrifying vision of him and his friends dying in a plane crash, he prevents the accident only to have Death hunt them down, one by one.', '/1mXhlQMnlfvJ2frxTjZSQNnA9Vp.jpg', '/6KDLAU9OnA0FhXP1av8jqavCGG9.jpg', '2000-03-17', 6.6, 6003, 78.504, '[27]', 'en', 'Final Destination', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(37, 939243, 'Sonic the Hedgehog 3', 'Sonic, Knuckles, and Tails reunite against a powerful new adversary, Shadow, a mysterious villain with powers unlike anything they have faced before. With their abilities outmatched in every way, Team Sonic must seek out an unlikely alliance in hopes of stopping Shadow and protecting the planet.', '/d8Ryb8AunYAuycVKDp5HpdWPKgC.jpg', '/zOpe0eHsq0A2NvNyBbtT6sj53qV.jpg', '2024-12-19', 7.7, 2620, 80.987, '[28, 878, 35, 10751]', 'en', 'Sonic the Hedgehog 3', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(38, 1011477, 'Karate Kid: Legends', 'After a family tragedy, kung fu prodigy Li Fong is uprooted from his home in Beijing and forced to move to New York City with his mother. When a new friend needs his help, Li enters a karate competition – but his skills alone aren\'t enough. Li\'s kung fu teacher Mr. Han enlists original Karate Kid Daniel LaRusso for help, and Li learns a new way to fight, merging their two styles into one for the ultimate martial arts showdown.', '/iXbNjhz2KU64vq6NEVVG5pIxggy.jpg', '/lAnkMSDISzMYLWICS7m16rSTUHD.jpg', '2025-05-08', 7.6, 45, 81.016, '[28, 12, 18]', 'en', 'Karate Kid: Legends', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(39, 20760, 'Lilo & Stitch 2: Stitch Has a Glitch', 'Now, we find the rowdy extraterrestrial getting used to life with his new ʻohana. However, a malfunction in the ultimate creation of Dr. Jumba soon emerges, which reinstates his destructive programming and threatens to both ruin his friendship with Lilo and to short him out for good!', '/p2R4mhZcikWEBlqv80VfJ7M9xql.jpg', '/5blbwmFZekM3ffqxDoveupJck5C.jpg', '2005-08-22', 6.7, 1492, 82.078, '[16, 10751, 35, 878]', 'en', 'Lilo & Stitch 2: Stitch Has a Glitch', 0, 0, '2025-05-28 04:39:17', '2025-05-28 05:00:19'),
(40, 55779, 'Final Destination 5', 'Death is just as omnipresent as ever, and is unleashed after one man’s premonition saves a group of coworkers from a terrifying suspension bridge collapse. But this group of unsuspecting souls was never supposed to survive, and, in a terrifying race against time, the ill-fated group frantically tries to discover a way to escape Death’s sinister agenda.', '/5uRF7zATPr0hIMfDcMEfnhMGw6a.jpg', '/zhFOEVvwyJjGsAqf31FF3H9OXlH.jpg', '2011-08-12', 6.1, 3639, 66.174, '[27, 9648]', 'en', 'Final Destination 5', 0, 0, '2025-05-28 04:39:17', '2025-05-29 00:03:28'),
(41, 914, 'The Great Dictator', 'Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel\'s regime.', '/nhMXB8GTdswYMCL9nepDZymJCOr.jpg', '/c8Pi8F1FzpNebtgXcSjC9nWCdSW.jpg', '1940-10-15', 8.3, 3462, 60.850, '[35, 10752]', 'en', 'The Great Dictator', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(42, 1124620, 'The Monkey', 'When twin brothers find a mysterious wind-up monkey, a series of outrageous deaths tear their family apart. Twenty-five years later, the monkey begins a new killing spree forcing the estranged brothers to confront the cursed toy.', '/yYa8Onk9ow7ukcnfp2QWVvjWYel.jpg', '/6dC7ULfiutxwEAs7LjWHL2Tc7Zv.jpg', '2025-02-14', 5.9, 658, 66.718, '[27, 35]', 'en', 'The Monkey', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(43, 1153714, 'Death of a Unicorn', 'A father and daughter accidentally hit and kill a unicorn while en route to a weekend retreat, where his billionaire boss seeks to exploit the creature’s miraculous curative properties.', '/lXR32JepFwD1UHkplWqtBP1K79z.jpg', '/eDBZN0TbWkxoAB0qIDFagVcPPTN.jpg', '2025-03-27', 6.4, 252, 62.007, '[27, 14, 35]', 'en', 'Death of a Unicorn', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(44, 1040159, 'My Massive Cock', 'An extra-large penis is an object of desire for many. But for some men, extra-large seriously complicates their lives and relationships, and penis reduction surgery seems the only answer.', '/9JQHViS8uugeWKfFsnEj3xTB2dZ.jpg', '/yATuNOVifq933nYIqHX9LNp83Vx.jpg', '2022-10-24', 5.8, 8, 57.895, '[99]', 'en', 'My Massive Cock', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(45, 1482554, 'Soul to Squeeze', 'Jacob\'s got problems-deep, mental ones. Desperate for relief, he volunteers for a radical treatment to escape his tortured mind. But instead of peace, he finds himself trapped in a house with a tunnel to his subconscious. What begins as a path to healing becomes a harrowing descent where memory fractures, time distorts, and reality bends. A first-of-its-kind cinematic experience, Soul to Squeeze begins in a boxy 4:3 aspect ratio and ever so slowly widens to a full 2.35:1 by the final frame-mirroring Jacob\'s expanding perception as he risks everything for redemption. Visually daring and emotionally raw, Soul to Squeeze merges body with mind, taking audiences on a perilous journey through the psyche.', '/bBJGmU0ORhmo0liy7c3MdI8qOMU.jpg', '/4uqj7jBpFnJLPCGB468fFoRrFlZ.jpg', '2025-05-16', 4.7, 3, 53.710, '[53, 18, 878]', 'en', 'Soul to Squeeze', 0, 0, '2025-05-28 04:39:18', '2025-05-28 04:39:18'),
(46, 1276073, 'Bullet Train Explosion', 'When panic erupts on a Tokyo-bound bullet train that will explode if it slows below 100 kph, authorities race against time to save everyone on board.', '/jmzxlDBwgvRbpPJzNQwizyn9UEn.jpg', '/Zes06xI18u47pblwRGTtqRm0R8.jpg', '2025-04-23', 6.9, 186, 54.765, '[28, 53, 80, 18]', 'ja', '新幹線大爆破', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(47, 1195506, 'Novocaine', 'When the girl of his dreams is kidnapped, everyman Nate turns his inability to feel pain into an unexpected strength in his fight to get her back.', '/xmMHGz9dVRaMY6rRAlEX4W0Wdhm.jpg', '/sNx1A3822kEbqeUxvo5A08o4N7o.jpg', '2025-03-12', 6.9, 809, 62.443, '[28, 35, 53]', 'en', 'Novocaine', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(48, 715287, 'Stepmom\'s Desire', 'Sang-jin, who was envious of her neighbor after getting a beautiful wife, Ask your wife\'s friend Gian to take over the son\'s extracurricular teacher, Sang-jin, who left work early, accidentally sees Gian\'s shower. A man who wants to have sex with his son\'s tutor, And a son who wants to have a good time with a young stepmom, Ji-an and Jin-hee, who want money, are disappointed with her husband, and Bin-jin gives her body to a young son.', '/rYC6UyML4CU4zYiZVbDMrwnGyWW.jpg', '/54mPXhtaUejdQtaCYeJPJP8ZfXX.jpg', '2020-05-29', 6.9, 18, 67.038, '[18, 10749]', 'ko', '새엄마의 욕망', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(49, 7451, 'xXx', 'Xander Cage is your standard adrenaline junkie with no fear and a lousy attitude. When the US Government \"recruits\" him to go on a mission, he\'s not exactly thrilled. His mission: to gather information on an organization that may just be planning the destruction of the world, led by the nihilistic Yorgi.', '/xeEw3eLeSFmJgXZzmF2Efww0q3s.jpg', '/qwK9soQmmJ7kRdjLZVXblw3g7AQ.jpg', '2002-08-09', 5.9, 4423, 59.933, '[28, 12, 53, 80]', 'en', 'xXx', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(50, 950396, 'The Gorge', 'Two highly trained operatives grow close from a distance after being sent to guard opposite sides of a mysterious gorge. When an evil below emerges, they must work together to survive what lies within.', '/7iMBZzVZtG0oBug4TfqDb9ZxAOa.jpg', '/9nhjGaFLKtddDPtPaX5EmKqsWdH.jpg', '2025-02-13', 7.7, 2625, 59.096, '[10749, 878, 53]', 'en', 'The Gorge', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(51, 1010581, 'My Fault', 'Noah must leave her city, boyfriend, and friends to move into William Leister\'s mansion, the flashy and wealthy husband of her mother Rafaela. As a proud and independent 17 year old, Noah resists living in a mansion surrounded by luxury. However, it is there where she meets Nick, her new stepbrother, and the clash of their strong personalities becomes evident from the very beginning.', '/w46Vw536HwNnEzOa7J24YH9DPRS.jpg', '/oz4U9eA6ilYf1tyiVuGmkftdLac.jpg', '2023-06-08', 7.8, 3696, 60.445, '[10749, 18]', 'es', 'Culpa mía', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:28'),
(52, 1180763, 'From the Shadows', 'When Dr. Joseph Cawl and members of his Hidden Wisdom cult die in a mysterious fire, survivors contact a paranormal expert to find the truth. What they discover makes them the next target of a deranged killer.', '/22aFuf6UnDaGP9G5CLfF92Cj1nf.jpg', '/d4h5A6tcJYwnU4HI3oSiNrqkgwN.jpg', '2023-09-22', 3.1, 4, 51.646, '[53, 878, 27]', 'en', 'From the Shadows', 0, 0, '2025-05-28 04:39:18', '2025-05-28 04:39:18'),
(53, 1180906, 'Desert Dawn', 'A newly appointed small-town sheriff and his begrudging deputy get tangled up in a web of lies and corruption involving shady businessmen and the cartel while investigating the murder of a mysterious woman.', '/S21BfLrJSD9njucBfY3CKqp8rD.jpg', '/bFmziv84NfEVEGTK8c6EVY3bxve.jpg', '2025-05-15', 7.6, 7, 57.838, '[28, 80, 9648, 53]', 'en', 'Desert Dawn', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(54, 1126166, 'Flight Risk', 'A U.S. Marshal escorts a government witness to trial after he\'s accused of getting involved with a mob boss, only to discover that the pilot who is transporting them is also a hitman sent to assassinate the informant. After they subdue him, they\'re forced to fly together after discovering that there are others attempting to eliminate them.', '/q0bCG4NX32iIEsRFZqRtuvzNCyZ.jpg', '/hwlyY7LJdEFbCPaGNXiskKKmJ5X.jpg', '2025-01-22', 6.1, 749, 56.665, '[28, 53]', 'en', 'Flight Risk', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(55, 1184918, 'The Wild Robot', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', '/9w0Vh9eizfBXrcomiaFWTIPdboo.jpg', '/1pmXyN3sKeYoUhu5VBZiDU4BX21.jpg', '2024-09-12', 8.3, 4964, 57.479, '[16, 878, 10751]', 'en', 'The Wild Robot', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(56, 1356236, 'Saint Catherine', 'An orphaned girl is rescued from a satanic ritual and taken to Saint Catherine Institute for homeless youth. There she will learn new skills while facing demons that stalk her.', '/hBJdzKPeDaC96AzlrtMWBomYSZV.jpg', '/svLj9iyRmmeNVRsMreANn7DPPZE.jpg', '2024-09-24', 6.9, 40, 51.489, '[27]', 'en', 'Saint Catherine', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(57, 1045938, 'G20', 'After the G20 Summit is overtaken by terrorists, President Danielle Sutton must bring all her statecraft and military experience to defend her family and her fellow leaders.', '/wv6oWAleCJZUk5htrGg413t3GCy.jpg', '/k32XKMjmXMGeydykD32jfER3BVI.jpg', '2025-04-10', 6.5, 502, 51.602, '[28, 9648, 18]', 'en', 'G20', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(58, 1252309, 'Ask Me What You Want', 'After his father\'s death, Eric Zimmerman travels to Spain to oversee his company\'s branches. In Madrid, he falls for Judith and engage in an intense, erotic relationship full of exploration. However, Eric fears his secret may end their affair.', '/k82T5L1utX1G2LhNWeza9nGUKPk.jpg', '/94kQrbY3PZ97PO1mE1dwd04Hdee.jpg', '2024-11-29', 6.1, 186, 52.019, '[10749, 18]', 'es', 'Pídeme lo que quieras', 0, 0, '2025-05-28 04:39:18', '2025-05-29 00:03:29'),
(59, 1471014, 'Van Gogh by Vincent', 'In a career that lasted only ten years, Vincent Van Gogh painted one subject more than any other: himself. This is the story of Vincent told using eight of his most iconic self-portraits.', '/z73X4WKZghBh5fri31o8P6vBEB2.jpg', '/1AWjIUgbZYaKbwUH5qoJaKCcRkf.jpg', '2025-03-26', 6.0, 16, 51.865, '[99]', 'fr', 'Van Gogh by Vincent', 0, 0, '2025-05-28 04:39:18', '2025-05-28 04:39:18'),
(60, 1414048, 'Day of Reckoning', 'Put-upon lawman John Dorsey is on the verge of losing his wife and his job as sheriff, so he posses up with bullish U.S. Marshall Butch Hayden to hold outlaw Emily Rusk hostage. A battle of wills ensues as Emily turns the posse on themselves, but as her marauding husband and his gang approach, Emily and John realize they will need each other to survive.', '/cVSjSQryFUERYSdOmdgJ2m0eBte.jpg', '/1hBtO9tXP60IFBZD27OsbaBmxs5.jpg', '2025-03-28', 6.7, 17, 54.234, '[37, 28]', 'en', 'Day of Reckoning', 0, 0, '2025-05-28 04:39:18', '2025-05-28 04:39:18'),
(61, 954, 'Mission: Impossible', 'When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the prime suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.', '/l5uxY5m5OInWpcExIpKG6AR3rgL.jpg', '/sra8XnL96OyLHENcglmZJg6HA8z.jpg', '1996-05-22', 7.0, 9250, 53.647, '[12, 28, 53]', 'en', 'Mission: Impossible', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(62, 9358, 'Final Destination 2', 'When Kimberly has a violent premonition of a highway pileup she blocks the freeway, keeping a few others meant to die, safe...Or are they? The survivors mysteriously start dying and it\'s up to Kimberly to stop it before she\'s next.', '/dg6Tf98InieJSClSKQJTQevYWmB.jpg', '/tKnmfO5lAyu8hpTZMyMaI4lhZpJ.jpg', '2003-01-31', 6.3, 4329, 51.626, '[27, 9648]', 'en', 'Final Destination 2', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(63, 458220, 'Palmer', 'After 12 years in prison, former high school football star Eddie Palmer returns home to put his life back together—and forms an unlikely bond with Sam, an outcast boy from a troubled home. But Eddie\'s past threatens to ruin his new life and family.', '/xSDdRAjxKAGi8fUBLOqSrBhJmF0.jpg', '/mlBmnjDJfsAhvqRVc2aFOjsfh8M.jpg', '2021-01-28', 8.1, 1743, 48.256, '[18]', 'en', 'Palmer', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(64, 912649, 'Venom: The Last Dance', 'Eddie and Venom are on the run. Hunted by both of their worlds and with the net closing in, the duo are forced into a devastating decision that will bring the curtains down on Venom and Eddie\'s last dance.', '/vGXptEdgZIhPg3cGlc7e8sNPC2e.jpg', '/3V4kLQg0kSqPLctI5ziYWabAZYF.jpg', '2024-10-22', 6.7, 3403, 51.587, '[28, 878, 12]', 'en', 'Venom: The Last Dance', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(65, 959604, 'Beating Hearts', 'Local rebellious teenager Clotaire falls for his schoolmate Jackie, but gang violence leads him to a darker destructive path. After years apart, the star-crossed lovers discover that every path they\'ve taken leads them back together.', '/yu9dRyKcUHTfKcqsomUtpord4t3.jpg', '/lBcXozUeABairkTavz3X3ZAtOL0.jpg', '2024-10-16', 7.2, 792, 55.361, '[80, 18, 10749]', 'fr', 'L\'Amour ouf', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(66, 1092899, 'The Siege', 'International assassin Walker is compromised during a mission and sent to a reassignment center for a new identity. During his stay at the facility, a ruthless assault team storms the compound searching for someone their boss has lost. Walker begrudgingly falls in with skilled hitwoman Elda and her mysterious ward Juliet in order to survive the night.', '/hVh4hMzkXNLnScudbid6hDvjMPk.jpg', '/4eC0tsU9OxR3Adlo1yRJYUDraW9.jpg', '2023-03-10', 5.4, 52, 50.354, '[28, 53]', 'en', 'The Siege', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(67, 533535, 'Deadpool & Wolverine', 'A listless Wade Wilson toils away in civilian life with his days as the morally flexible mercenary, Deadpool, behind him. But when his homeworld faces an existential threat, Wade must reluctantly suit-up again with an even more reluctant Wolverine.', '/8cdWjvZQUExUUTzyp4t6EDMubfO.jpg', '/by8z9Fe8y7p4jo2YlW2SZDnptyT.jpg', '2024-07-24', 7.6, 7280, 51.009, '[28, 35, 878]', 'en', 'Deadpool & Wolverine', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(68, 1284120, 'The Ugly Stepsister', 'In a fairy-tale kingdom where beauty is a brutal business, Elvira battles to compete with her incredibly beautiful stepsister, and she will go to any length to catch the prince’s eye.', '/crX9rSg9EohybhkEe8iTQUCe55y.jpg', '/eQV9rSQ6S1ja4lGTwHTnQuVhoG.jpg', '2025-03-07', 7.0, 92, 51.428, '[27, 18]', 'no', 'Den stygge stesøsteren', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(69, 9286, 'Final Destination 3', 'High school senior Wendy\'s premonition of a deadly rollercoaster ride saves her life and a lucky few, but not from death itself — which seeks out those who escaped their fate.', '/5yiwJqCDllkEaxvJKgUnhyIPEwE.jpg', '/nSV1NIAK0Sp5dM1oiobtqbJ8Jrv.jpg', '2006-02-09', 6.1, 4105, 47.398, '[27, 9648]', 'en', 'Final Destination 3', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(70, 811941, 'Devara: Part 1', 'Devara, a fearless man from a coastal region, embarks on a perilous journey into the treacherous world of the sea to safeguard the lives of his people. Unbeknownst to him, his brother Bhaira is plotting a conspiracy against him. As events unfold, Devara passes on his legacy to his mild-mannered and timid son, Varada.', '/1105WNYals12Va2f4F3VeBZdcWX.jpg', '/hAQnXxOwCjgYcKRgTdYPRC8neqL.jpg', '2024-09-26', 7.0, 194, 48.310, '[28, 18]', 'te', 'Devara: Part 1', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(71, 778578, 'Cry of Silence', 'Cry of Silence, is about a double kidnapping, and assault that is presented as an Action Packed ,Dramatic, Thriller that will keep you riveted.', '/dsUimI4VI1SCI1t8jS7ZwBwt1DW.jpg', '/glmdmHhgqodnnRzhntq2a6vrfOr.jpg', '2024-05-01', 5.8, 13, 48.423, '[53, 18, 28]', 'en', 'Cry of Silence', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(72, 696506, 'Mickey 17', 'Unlikely hero Mickey Barnes finds himself in the extraordinary circumstance of working for an employer who demands the ultimate commitment to the job… to die, for a living.', '/edKpE9B5qN3e559OuMCLZdW1iBZ.jpg', '/pkZ8SaIQwjBuS1fcJJE7Are7IrL.jpg', '2025-02-28', 6.9, 2068, 50.582, '[878, 35, 12]', 'en', 'Mickey 17', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(73, 1011985, 'Kung Fu Panda 4', 'Po is gearing up to become the spiritual leader of his Valley of Peace, but also needs someone to take his place as Dragon Warrior. As such, he will train a new kung fu practitioner for the spot and will encounter a villain called the Chameleon who conjures villains from the past.', '/nqXsAaQsKw2gKpkfhIgjXNDRqg7.jpg', '/kYgQzzjNis5jJalYtIHgrom0gOx.jpg', '2024-03-02', 7.1, 3085, 48.029, '[16, 10751, 28, 35, 12, 14]', 'en', 'Kung Fu Panda 4', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(74, 519182, 'Despicable Me 4', 'Gru and Lucy and their girls—Margo, Edith and Agnes—welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru also faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, forcing the family to go on the run.', '/wWba3TaojhK7NdycRhoQpsG0FaH.jpg', '/lgkPzcOSnTvjeMnuFzozRO5HHw1.jpg', '2024-06-20', 7.0, 2775, 50.592, '[16, 10751, 35, 878]', 'en', 'Despicable Me 4', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(75, 933260, 'The Substance', 'A fading celebrity decides to use a black market drug, a cell-replicating substance that temporarily creates a younger, better version of herself.', '/lqoMzCcZYEFK729d6qzt349fB4o.jpg', '/wMEhptvj6pcp2QSzHYcl4DFA5Pz.jpg', '2024-09-07', 7.1, 4666, 46.396, '[27, 878]', 'en', 'The Substance', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:29'),
(76, 1260820, 'Stream', 'Craven, a streamer with thousands of followers on a live streaming platform, has prepared a very special stream for Halloween. What no one expects when reacting to a video of Pentagram, a group of young paranormal investigators, is that the live experience will turn into the worst night of their lives. And maybe... the last.', '/nnyjtBfUYA8ASHA9OhADrX0sMNQ.jpg', '/jI8j3vy1fFZpjaGA6ALuyQuadfm.jpg', '2024-02-06', 6.3, 17, 43.685, '[27]', 'es', 'Stream', 0, 0, '2025-05-28 04:39:19', '2025-05-28 04:39:19'),
(77, 19912, 'The Final Destination', 'A horrifying premonition saves a young man and his friends from death during a racetrack accident but terrible fates await them nonetheless.', '/5vxXrr1MqGsT4NNeRITpfDnl4Rq.jpg', '/vMaKc5PwdKIIBt5q7JQjfgyESYT.jpg', '2009-08-26', 5.6, 3467, 45.279, '[27, 9648]', 'en', 'The Final Destination', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:30'),
(78, 1022789, 'Inside Out 2', 'Teenager Riley\'s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, who’ve long been running a successful operation by all accounts, aren’t sure how to feel when Anxiety shows up. And it looks like she’s not alone.', '/vpnVM9B6NMmQpWeZvzLvDESb2QY.jpg', '/p5ozvmdgsmbWe0H8Xk7Rc8SCwAB.jpg', '2024-06-11', 7.6, 5872, 45.609, '[16, 12, 35, 10751]', 'en', 'Inside Out 2', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:30'),
(79, 558449, 'Gladiator II', 'Years after witnessing the death of the revered hero Maximus at the hands of his uncle, Lucius is forced to enter the Colosseum after his home is conquered by the tyrannical Emperors who now lead Rome with an iron fist. With rage in his heart and the future of the Empire at stake, Lucius must look to his past to find strength and honor to return the glory of Rome to its people.', '/2cxhvwyEwRlysAmRH4iodkvo0z5.jpg', '/euYIwmwkmz95mnXvufEmbL6ovhZ.jpg', '2024-11-13', 6.7, 3410, 45.154, '[28, 12, 18]', 'en', 'Gladiator II', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:30'),
(80, 870028, 'The Accountant²', 'When an old acquaintance is murdered, Wolff is compelled to solve the case. Realizing more extreme measures are necessary, Wolff recruits his estranged and highly lethal brother, Brax, to help. In partnership with Marybeth Medina, they uncover a deadly conspiracy, becoming targets of a ruthless network of killers who will stop at nothing to keep their secrets buried.', '/kMDUS7VmFhb2coRfVBoGLR8ADBt.jpg', '/rdxdvXQGqCj2Vb7SvTL8gdxlSzI.jpg', '2025-04-23', 7.1, 178, 42.371, '[80, 53, 28]', 'en', 'The Accountant²', 0, 0, '2025-05-28 04:39:19', '2025-05-29 00:03:30'),
(81, 823219, 'Flow', 'A solitary cat, displaced by a great flood, finds refuge on a boat with various species and must navigate the challenges of adapting to a transformed world together.', '/imKSymKBK7o73sajciEmndJoVkR.jpg', '/b3mdmjYTEL70j7nuXATUAD9qgu4.jpg', '2024-08-29', 8.2, 1984, 44.448, '[16, 14, 12]', 'lv', 'Straume', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30'),
(82, 539972, 'Kraven the Hunter', 'Kraven Kravinoff\'s complex relationship with his ruthless gangster father, Nikolai, starts him down a path of vengeance with brutal consequences, motivating him to become not only the greatest hunter in the world, but also one of its most feared.', '/1GvBhRxY6MELDfxFrete6BNhBB5.jpg', '/v9Du2HC3hlknAvGlWhquRbeifwW.jpg', '2024-12-11', 6.6, 1709, 44.855, '[28, 12, 53]', 'en', 'Kraven the Hunter', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30'),
(83, 1313194, 'Summer of 69', 'In an effort to land the guy she\'s been pining after since grade school, Abby hires a local stripper named Santa Monica to teach her everything she needs to know about confidence and sex.', '/xBmsHHLwvwI29oyFE48fKAnSQyk.jpg', '/jaPnd7NG0LqZ8H0Qox4gYhjRCrS.jpg', '2025-03-13', 6.4, 27, 40.531, '[35, 18]', 'en', 'Summer of 69', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(84, 24428, 'The Avengers', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', '/RYMX2wcKCBAr24UyPD7xwmjaTn.jpg', '/9BBTo63ANSmhC4e6r62OJFuK2GL.jpg', '2012-04-25', 7.8, 31906, 42.942, '[878, 28, 12]', 'en', 'The Avengers', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30'),
(85, 842328, 'Wish You Were Here', 'Charlotte finds herself in a rut, searching for a spark that seems just out of reach. After she has a whirlwind night of romance and imagining a future with a man named Adam, he ghosts her. When Charlotte finally discovers that Adam is terminally ill, she helps him spend his last days living life to the fullest.', '/uX40XUTBJFIskKmpThelUnRXelq.jpg', '/fBvBufYLNLcDpEBs07Hv1arRY98.jpg', '2025-01-17', 6.6, 13, 38.456, '[10749, 18]', 'en', 'Wish You Were Here', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(86, 1323784, 'Bad Influence', 'An ex-con gets a fresh start when hired to protect a wealthy heiress from a stalker — but their chemistry is hard to resist as they grow closer.', '/ghhooCOqQDqC6vhS1SVN2tCE0k8.jpg', '/zXUxcXnBPHF1cD0IHi4KUpsNvF4.jpg', '2025-01-24', 5.7, 142, 37.325, '[53, 18, 10749]', 'es', 'Mala influencia', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(87, 1156593, 'Your Fault', 'The love between Noah and Nick seems unwavering despite their parents\' attempts to separate them. But his job and her entry into college open up their lives to new relationships that will shake the foundations of both their relationship and the Leister family itself.', '/1sQA7lfcF9yUyoLYC0e6Zo3jmxE.jpg', '/k24eZq5I3jyz4htPkZCRpnUmBzE.jpg', '2024-12-26', 7.1, 1253, 39.586, '[10749, 18]', 'es', 'Culpa tuya', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(88, 846433, 'The Enforcer', 'A noir thriller set in Miami, the film follows an enforcer who discovers his femme fatale boss has branched out into cyber sex trafficking, putting a young runaway he’s befriended at risk. He sacrifices everything to save the young girl from the deadly organization he’s spent his life building.', '/72V1r1G8S87ELagVxjqAUdChMCt.jpg', '/Aqldsq65Nj1KAkQD2MzkZsAk5N5.jpg', '2022-09-22', 7.1, 430, 33.846, '[28, 80, 18]', 'en', 'The Enforcer', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(89, 21316, 'Leroy & Stitch', 'Lilo, Stitch, Jumba, and Pleakley have finally caught all of Jumba\'s genetic experiments and found the one true place where each of them belongs. Stitch, Jumba and Pleakley are offered positions in the Galactic Alliance, turning them down so they can stay on Earth with Lilo, but Lilo realizes her alien friends have places where they belong – and it\'s finally time to say \"aloha\".', '/8ddTcTllI5U1Gq2EvGYE2CBprOS.jpg', '/f5afU9XaUuPxrHcYm2hc87C2dnt.jpg', '2006-06-23', 6.6, 550, 44.039, '[16, 35, 10751, 10770]', 'en', 'Leroy & Stitch', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30'),
(90, 927342, 'Amaran', 'A heroic true story of Major Mukund Varadarajan, an Indian Army officer who displayed extraordinary bravery during a counterterrorism mission in Kashmir’s Shopian district. The film captures his courage in protecting his nation and the devotion of his wife Indhu Rebecaa Varghese.', '/eCB06m1KUGilEOlIzb40nkQhVY0.jpg', '/7cNE2qydew1c8fqnlhWjkE3DHc2.jpg', '2024-10-31', 7.4, 230, 39.812, '[28, 18, 12, 10752]', 'ta', 'அமரன்', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(91, 974573, 'Another Simple Favor', 'Stephanie and Emily reunite on the beautiful island of Capri, Italy for Emily\'s extravagant wedding to a rich Italian businessman. Along with the glamorous guests, expect murder and betrayal to RSVP for a wedding with more twists and turns than the road from the Marina Grande to the Capri town square.', '/zboCGZ4aIqPMd7VFI4HWnmc7KYJ.jpg', '/b6e5Nss2QNoQM4wJv2VppChswNP.jpg', '2025-03-07', 5.9, 292, 36.722, '[35, 53, 80]', 'en', 'Another Simple Favor', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(92, 1251621, 'Waves', 'At the end of the 1960s, when the air is filled with rock-and-roll and student rebellions are changing the world, the older of two brothers joins a prestigious newsroom of the public radio broadcaster. Not long after, he finds himself in the middle of a dangerous conflict between journalists and the secret service.', '/sXxvWOBdWDJwWXmX4nKgQsWLLKC.jpg', '/6p0ZlZW4wp7nUOGEZgO6lxyswdi.jpg', '2024-08-01', 7.5, 33, 39.535, '[53, 18, 36]', 'cs', 'Vlny', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(93, 1293286, 'Gunslingers', 'When the most wanted man in America surfaces in a small Kentucky town, his violent history -- and a blood-thirsty mob seeking vengeance and a king’s ransom -- soon follow. As brothers face off against one another and bullets tear the town to shreds, this lightning-fast gunslinger makes his enemies pay the ultimate price for their greed.', '/O7REXWPANWXvX2jhQydHjAq2DV.jpg', '/zksO4lVnRKRoaSYzh2EDn2Z3Pel.jpg', '2025-04-11', 6.5, 53, 38.126, '[37, 28]', 'en', 'Gunslingers', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(94, 1064486, 'Memoir of a Snail', 'Forcibly separated from her twin brother when they are orphaned, a melancholic misfit learns how to find confidence within herself amid the clutter of misfortunes and everyday life.', '/woaN8CbloH0akyX0E72ayxlJAB4.jpg', '/jl2YIADk391yc6Qjy9JhgCRkHJk.jpg', '2024-10-17', 8.1, 515, 37.074, '[16, 18, 35]', 'en', 'Memoir of a Snail', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(95, 1244944, 'The Woman in the Yard', 'In the aftermath of her husband\'s death, widow Ramona\'s struggle to raise her two kids is hindered by the arrival of a mysterious woman with supernatural abilities.', '/n0WS2TsNcS6dtaZKzxipyO7LuCJ.jpg', '/3lEV4CoKoeT2cZ4fbKEJugZcw6Z.jpg', '2025-03-27', 6.2, 170, 35.918, '[27, 9648]', 'en', 'The Woman in the Yard', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(96, 1212855, 'Fight or Flight', 'A mercenary takes on the job of tracking down a target on a plane but must protect her when they\'re surrounded by people trying to kill both of them.', '/dNyzZaMDS5hmOzWHFgNlgRRPDB0.jpg', '/6J259Zuq09Bt2PLUNeTS5a3DwLZ.jpg', '2025-04-03', 5.9, 112, 37.007, '[28, 35, 53]', 'en', 'Fight or Flight', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(97, 1078600, 'Marked Men: Rule + Shaw', 'Shaw Landon has loved Rule Archer from the moment she laid eyes on him. Rule, a fiery-tempered rebel tattoo artist, doesn’t have time for a good girl pre-med student like Shaw — even if she’s the only one who can see the person he truly is. She lives by other people’s rules; he makes his own. But a short skirt, too many birthday cocktails, and spilled secrets lead to a night neither can forget. Now, Shaw and Rule must figure out how a girl like her and a guy like him are supposed to be together without destroying their love…or each other.', '/gZQU8BtCH2IbMZq6QETiU4HXQSR.jpg', '/9qYD7pAOEdYBoQblv5VAMMSVAC8.jpg', '2025-01-22', 6.4, 72, 34.836, '[10749, 18]', 'en', 'Marked Men: Rule + Shaw', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(98, 259872, 'Skin. Like. Sun.', 'Real-life young couple Wim and Floor spend an afternoon in the sunwashed rooms of a crumbling home in Belgium. In a unique twist, this artistic erotic documentary is edited in nearly real-time. In the slowness, we get the build, the sweetness, and the sexiness. Forget about fingersnapping fast editing. Slow is where it’s at.', '/uCkANtG6ezb7hjRKVudY3PUcbvn.jpg', '/dzY2ZYyPRbXcw8UOupHK3V5VQYk.jpg', '2009-10-10', 5.8, 96, 38.665, '[10749]', 'fr', 'Des jours plus belles que la nuit', 0, 0, '2025-05-28 04:39:20', '2025-05-28 05:00:21'),
(99, 353081, 'Mission: Impossible - Fallout', 'When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.', '/AkJQpZp9WoNdj7pLYSj1L0RcMMN.jpg', '/aw4FOsWr2FY373nKSxbpNi3fz4F.jpg', '2018-07-13', 7.4, 8521, 38.549, '[28, 12]', 'en', 'Mission: Impossible - Fallout', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30'),
(100, 157336, 'Interstellar', 'The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.', '/gEU2QniE6E77NI6lCU6MxlNBvIx.jpg', '/l33oR0mnvf20avWyIMxW02EtQxn.jpg', '2014-11-05', 8.5, 37187, 39.352, '[12, 18, 878]', 'en', 'Interstellar', 0, 0, '2025-05-28 04:39:20', '2025-05-29 00:03:30');
INSERT INTO `movies` (`id`, `tmdb_id`, `title`, `overview`, `poster_path`, `backdrop_path`, `release_date`, `vote_average`, `vote_count`, `popularity`, `genre_ids`, `original_language`, `original_title`, `adult`, `video`, `created_at`, `updated_at`) VALUES
(101, 1257960, 'Sikandar', 'A tragic accident pushes the powerful Sikandar to protect the less fortunate by standing up to corruption and greed — using any means necessary.', '/t48miSSfe7COqgbgMyRIyPVTBoM.jpg', '/xLhVwypEHzgcUhRzpCweDUEvtzG.jpg', '2025-03-29', 4.8, 21, 154.086, '[28, 18]', 'hi', 'सिकंदर', 0, 0, '2025-05-29 00:03:27', '2025-05-29 00:03:27'),
(102, 676685, 'Panda Bear in Africa', 'A young adventurous panda travels from China to Africa to rescue his best friend, Jielong the Dragon, who has been kidnapped. On his journey, he discovers a strange amazing new world of mountains, deserts and jungles.', '/wxpu7svVqA0ALYpofQBPujGelN3.jpg', '/youmOAJwM4XCoHAgeYNXACA7Buc.jpg', '2024-03-15', 6.2, 24, 103.487, '[16, 12, 35, 10751]', 'nl', 'Pandabeer in Afrika', 0, 0, '2025-05-29 00:03:29', '2025-05-29 00:03:29'),
(103, 1323853, 'Norbert', 'Norbert an incompetent spy from a sad, bureaucratic and grey nation will become a key player to thwart the plans of his own government, in an exciting quest that will see him travel alongside strange companions.', '/2DYgEfgv1bOmgibE1kyPBmzxaf2.jpg', '/wvD8AYLHlWdNXDReR0nWRQp4X8S.jpg', '2025-01-17', 7.0, 3, 55.295, '[16, 12, 35]', 'es', 'Norbert', 0, 0, '2025-05-29 00:03:29', '2025-05-29 00:03:29'),
(104, 1484665, 'Lilo & Stitch | A Special Look', 'Get a special look at the all-new live action \"Lilo & Stitch,\" only in theaters.', '/cfEr66doblzMf9tlgHrpuHwQm4H.jpg', '/9NyN5E4SWnXpW2wyO37OsknvE1y.jpg', '2025-05-19', 0.0, 0, 52.167, '[99]', 'en', 'Lilo & Stitch | A Special Look', 0, 0, '2025-05-29 00:03:29', '2025-05-29 00:03:29'),
(105, 968171, 'Sex Education Mistresses', 'An erotic comedy depicting the sex adventures of  young wives living in an apartment complex, that are not satisfied with just having sex with their husbands.', '/xghWMg0pkBOdLHCTESyeyHU68wl.jpg', NULL, '1973-11-20', 5.9, 5, 39.085, '[35]', 'ja', '性教育ママ', 0, 0, '2025-05-29 00:03:30', '2025-05-29 00:03:30'),
(106, 15567, 'Stitch! The Movie', 'The continuing adventures of Lilo, a little Hawaiian girl, and Stitch, the galaxy\'s most-wanted extraterrestrial. Stitch, Pleakley, and Dr. Jumba are all part of the household now, but what Lilo and Stitch don\'t know is that Dr. Jumba brought his other alien \"experiments\" to Hawaiʻi as well.', '/flwMGZcOO80lqsnZ6lIwsKja5N.jpg', '/iEr3i8Qsaun2hRHUy7WH0gmfJBf.jpg', '2003-09-10', 6.4, 722, 37.586, '[35, 12, 10751, 16, 878]', 'en', 'Stitch! The Movie', 0, 0, '2025-05-29 00:03:30', '2025-05-29 00:03:30'),
(107, 1087192, 'How to Train Your Dragon', 'On the rugged isle of Berk, where Vikings and dragons have been bitter enemies for generations, Hiccup stands apart, defying centuries of tradition when he befriends Toothless, a feared Night Fury dragon. Their unlikely bond reveals the true nature of dragons, challenging the very foundations of Viking society.', '/47HoQdGvW4Jy4ntUbsQ3bEnJHDh.jpg', '/7HqLLVjdjhXS0Qoz1SgZofhkIpE.jpg', '2025-06-06', 0.0, 0, 37.577, '[28, 10751, 14]', 'en', 'How to Train Your Dragon', 0, 0, '2025-05-29 00:03:30', '2025-05-29 00:03:30');

